import React from "react";
import { MenuIcon, ShoppingCartIcon,ArrowLeftIcon,ArrowRightIcon } from "@heroicons/react/solid";

function Sneakers() {
  return (
    <div>
      <div className="flex justify-between mx-6 py-5 bg-white">
        <div className="flex items-center">
          <MenuIcon className="w-8 mr-3" />
          <img src="/images/snekarlogo.svg" alt="" />
        </div>
        <div className="flex items-center">
          <ShoppingCartIcon className="w-8 mr-3" />
          <img className="w-10" src="images/image-avatar.png" alt="" />
        </div>
      </div>
      <div>
        <div>
          <img src="/images/image-product-1.jpg" className="w-full max-h-96 object-cover" alt="" />
          <ArrowLeftIcon className="w-8 h-8 absolute left-0 top-[35%] bg-white p-5" />
          <ArrowRightIcon className="w-8 h-8 absolute right-0 top-[35%]" />
        </div>
      </div>
    </div>
  );
}

export default Sneakers;
